import React from 'react';
import Navbar from '../src/components/Navbar';
import Services from '../src/components/Services';
import Features from '../src/components/Features';
import Contact from '../src/components/Contact';
import SocialMedia from '../components/SocialMedia';
import Footer from '../src/components/Footer';
import FooterLinks from '../src/components/FooterLinks';
import Aux from '../hoc/Aux_';
import { Link } from 'react-router-dom';

class Platform extends React.Component {
  render() {

    var bkg1 = {
        backgroundImage: 'url(images/img-2.jpg)',
        backgroundSize : 'cover',
        backgroundPosition : 'center',
      };

  	return (
        <Aux>
                <Navbar />

                <section className="home-padding-t-150 position-relative" id="home"  style={bkg1}>
                    <div className="bg-overlay"></div>
                       <div className="display-table">
                            <div className="home-cell-bottom">
                                <div className="container">
                                    <div className="row">
                                        <div className="col-lg-8 offset-lg-2 text-white text-center">
                                            <h1 className="home-title">Our Platform</h1>
                                            <p className="padding-t-15 home-desc">Creating synergy for your enterprise </p>
                                            <img src="images/home-dashboard.jpg" alt="" className="img-fluid center-block margin-t-20" />  
                                        </div>
                                    </div>
                            </div>
                       </div>
                    </div>
                </section>


                <Services />

                {/* Features Component*/}
                <Features />

                {/* Contact Component*/}
                <Contact />

                {/* SocialMedia Component*/}
                <SocialMedia />

                {/* Footer Component*/}
                <Footer />

                {/* FooterLinks Component*/}
                <FooterLinks />
        </Aux>
  	);
  }
}

export default Platform
